/*Table structure for table `tbl_admin` */

DROP TABLE IF EXISTS `tbl_admin`;

CREATE TABLE `tbl_admin` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `username` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `pass` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `email` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `phone` varchar(15) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `date_created` datetime DEFAULT NULL,
  `active` tinyint(3) unsigned DEFAULT '1',
  `mobi` varchar(15) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `area_active` int(2) unsigned DEFAULT '99',
  `user_created` int(10) unsigned DEFAULT NULL,
  `user_update` int(10) unsigned DEFAULT NULL,
  `date_update` datetime DEFAULT NULL,
  `address` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `power_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`,`mobi`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8;

