insert  into `tbl_menu_cus`(`id`,`name_vi`,`main_menu_id`,`active`,`name_en`,`help_content_vi`,`id_control`,`ordershow`,`help_status`,`help_content_en`) values (1,'Trang chủ',1,1,'Home page','<p align=\"center\"><font size=\"4\"><span data-scayt_word=\"fdsfdsfsd\" data-scaytid=\"2\">H&igrave;nh ảnh trang chủ.</span></font></p>\n<p align=\"center\"><font size=\"4\"><span data-scayt_word=\"fdsfdsfsd\" data-scaytid=\"2\"><img alt=\"\" height=\"653\" src=\"/images/newtech/images/trangchu(1).png\" width=\"1000\"></span></font></p>\n<ol>\n	<li>C&aacute;ch đi đến \"trang chủ\" :</li>\n</ol>\n<ul>\n	<li>Khi người d&ugrave;ng đăng nhập v&agrave;o th&igrave; trang mặc định l&agrave; trang chủ.</li>\n	<li>Trường hợp ở trang kh&aacute;c muốn tới trang chủ th&igrave; click tab trang chủ tr&ecirc;n menu tab.</li>\n</ul>\n<p>2. Chức năng của trang chủ :</p>\n<ul>\n	<li>Cho xem tổng qu&aacute;t th&ocirc;ng tin về t&igrave;nh h&igrave;nh c&aacute;c ao nu&ocirc;i (tốt, cảnh b&aacute;o, mất li&ecirc;n kết với hệ thống).</li>\n	<li>Cho xem tổng vị tr&iacute; v&agrave; t&ecirc;n c&aacute;c ao nu&ocirc;i tr&ecirc;n bản đồ google map th&ocirc;ng qua c&aacute;c cửa sổ (infowindow). Từ cửa sổ&nbsp; infowindow m&igrave;nh c&oacute; thể thay t&ecirc;n ao khi click v&agrave;o phần t&ecirc;n ao .</li>\n</ul>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"thaydoitenao\" height=\"230\" src=\"/images/newtech/images/thaydoitenao.png\" width=\"378\"></p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp; Đặt lại t&ecirc;n ao mới bấm n&uacute;t \"Lưu\" để thay đổi. Bấm n&uacute;t \"Đ&oacute;ng\" để bỏ qua.</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Bấm \"link xem chi tiết\" để qua m&agrave;n h&igrave;nh theo d&otilde;i ao vừa bấm.</p>\n','w01_trangchu',1,1,NULL),(2,'Theo dõi',2,1,'Tracking','<p align=\"center\"><font size=\"4\">H&igrave;nh ảnh Theo d&otilde;i</font></p>\n<p align=\"center\"><img alt=\"hình theo dõi\" height=\"927\" src=\"/images/newtech/images/Theodoi2.png\" width=\"1000\"></p>\n<ol>\n	<li>C&aacute;ch đi đến trang \"theo d&otilde;i\":</li>\n</ol>\n<ul style=\"margin-left: 40px;\">\n	<li>Muốn v&agrave;o trang \"theo d&otilde;i\"&nbsp; khi ở trang kh&aacute;c th&igrave; click tab \"Theo d&otilde;i\" tr&ecirc;n menu tab.</li>\n	<li>Từ m&agrave;n h&igrave;nh \"Trang chủ\" c&oacute; thể qua trang theo d&otilde;i khi bấm v&agrave;o link \"xem chi tiết\" tr&ecirc;n cửa sổ infowindow.</li>\n</ul>\n<p>&nbsp;&nbsp;&nbsp;&nbsp; 2. Chức năng của trang theo d&otilde;i :</p>\n<ul style=\"margin-left: 40px;\">\n	<li>Cho xem th&ocirc;ng tin chi tiết về chỉ số của 1 ao v&agrave; th&ocirc;ng tin kỹ thuật, vận h&agrave;nh của thiết bị gắn tr&ecirc;n ao đ&oacute;.</li>\n	<li>Cho xem h&igrave;nh ao v&agrave; h&igrave;nh ảnh triển khai thực tế tại vị tr&iacute; ao nu&ocirc;i.</li>\n</ul>\n','w02_tracking',2,1,NULL),(3,'Báo cáo nhanh',3,1,'Quick report','<p align=\"center\"><font size=\"4\"><span data-scayt_word=\"toi\" data-scaytid=\"32\">H&igrave;nh ảnh b&aacute;o c&aacute;o nhanh</span></font></p>\n<p><font size=\"4\"><span data-scayt_word=\"toi\" data-scaytid=\"32\"><img alt=\"\" height=\"551\" src=\"/images/newtech/images/baocaonhanh.png\" width=\"1000\"></span></font></p>\n<ol>\n	<li><font size=\"4\"><span data-scayt_word=\"toi\" data-scaytid=\"32\">C&aacute;ch đến trang \"b&aacute;o c&aacute;o nhanh\" hay c&ograve;n gọi l&agrave; \"b&aacute;o c&aacute;o theo mốc đo\":</span></font></li>\n</ol>\n<ul style=\"margin-left: 40px;\">\n	<li>Click tab \"B&Aacute;O C&Aacute;O\" tr&ecirc;n menu tab sau đ&oacute; click v&agrave;o tab \"b&aacute;o c&aacute;o nhanh\" tr&ecirc;n menu con.</li>\n</ul>\n<p><font size=\"4\">&nbsp;&nbsp;&nbsp;&nbsp; 2. Chức năng của b&aacute;o c&aacute;o nhanh(BC theo mốc đo).</font></p>\n<ul style=\"margin-left: 40px;\">\n	<li>Cho ph&eacute;p người sử dụng xem b&aacute;o c&aacute;o theo những mốc thời gian đ&atilde; c&agrave;i đặt trước. Kh&ocirc;ng cần phải chọn lại.</li>\n	<li>Mỗi lần chỉ xem th&ocirc;ng tin 1 ao bằng c&aacute;ch chọn ao muốn xem.</li>\n	<li>C&oacute; thể xem 1 lần nhiều chỉ số nước ao nu&ocirc;i (oxy h&ograve;a tan, độ dẫn điện, độ pH...) bằng c&aacute;ch chọn tr&ecirc;n &ocirc; chỉ số.</li>\n	<li>Chọn lại mốc đo nếu người d&ugrave;ng muốn xem lại những mốc đo kh&aacute;c. ( người d&ugrave;ng thường xem những mốc đ&oacute; m&agrave; tại thời điểm đ&oacute; nước hay thay đổi mạnh về c&aacute;c chỉ số g&acirc;y ảnh hưởng đến sức khỏe của thủy sản.</li>\n	<li>Chọn lại khoảng thời gian muốn xem từ ng&agrave;y n&agrave;o đến ng&agrave;y n&agrave;o nếu kh&aacute;ch h&agrave;ng muốn xem lại lịch sử(mặc định của hệ thống l&agrave; 3 ng&agrave;y).</li>\n	<li>Tr&ecirc;n bảng b&aacute;o c&aacute;o nếu c&aacute;c chỉ số b&igrave;nh thường theo ngưỡng cho ph&eacute;p th&igrave; sẽ &ocirc; đ&oacute; c&oacute; m&agrave;u trắng, m&agrave;u cam l&agrave; dưới ngưỡng, m&agrave;u đỏ l&agrave; vượt ngưỡng.</li>\n</ul>\n','w03_bcnhanh',3,1,NULL),(4,'Báo cáo chi tiết',3,1,'Detail report','<p align=\"center\"><font size=\"5\">H&igrave;nh ảnh b&aacute;o c&aacute;o chi tiết</font></p>\n<p><font size=\"5\"><font size=\"4\"><img alt=\"báo cáo chi tiết\" height=\"1200\" src=\"/images/newtech/images/baocaochitiet.png\" width=\"983\"></font></font></p>\n<ol>\n	<li><font size=\"5\"><font size=\"4\">C&aacute;ch đi đến trang \"B&aacute;o c&aacute;o chi tiết\" :</font></font></li>\n</ol>\n<ul style=\"margin-left: 40px;\">\n	<li><font size=\"3\">Click tab \"B&Aacute;O C&Aacute;O\"&nbsp; tr&ecirc;n menu tab => click tab \"b&aacute;o c&aacute;o chi tiết\" tr&ecirc;n menu con.</font></li>\n</ul>\n<p><font size=\"5\"><font size=\"4\">&nbsp;&nbsp; 2. Chức năng của trang \"B&aacute;o c&aacute;o chi tiết\":</font></font></p>\n<ul style=\"margin-left: 40px;\">\n	<li><font size=\"3\">Cho người d&ugrave;ng xem chi tiết diễn biến c&aacute;c chỉ số&nbsp; nước ao nu&ocirc;i của 1 ao trong 1 khoảng thời gian n&agrave;o đ&oacute; tr&ecirc;n biểu đồ.</font></li>\n	<li><font size=\"3\">H&igrave;nh đầu ti&ecirc;n thể hiện tất cả c&aacute;c chỉ số nước tr&ecirc;n c&ugrave;ng biểu đồ.</font></li>\n	<li><font size=\"3\">C&aacute;c h&igrave;nh dưới thể hiện từng chỉ số nước ao nu&ocirc;i ứng với khoảng an to&agrave;n (ngưỡng cho ph&eacute;p) tr&ecirc;n của c&aacute;c chỉ số. V&ugrave;ng m&agrave;u xanh l&aacute; l&agrave; v&ugrave;ng an to&agrave;n tr&ecirc;n biểu đồ. </font></li>\n</ul>\n','w03_bcchitiet',4,1,NULL),(5,'Nguỡng cảnh báo',4,1,'Alert Threatholds','<p align=\"center\">H&igrave;nh ngưỡng cảnh b&aacute;o.</p>\n<p align=\"center\"><img alt=\"\" height=\"501\" src=\"/images/newtech/images/nguongcanhbao.png\" width=\"1000\"></p>\n<ol>\n	<li>C&aacute;ch đi đến trang \"Ngưỡng cảnh b&aacute;o\":</li>\n</ol>\n<ul style=\"margin-left: 40px;\">\n	<li>Click tab \"CẤU H&Igrave;NH\" tr&ecirc;n menu tab => clic tab \"Ngưỡng cảnh b&aacute;o\" tr&ecirc;n menu con.</li>\n</ul>\n<p>&nbsp;&nbsp;&nbsp;&nbsp; 2. Chức năng của trang \"Ngưỡng cảnh b&aacute;o\":</p>\n<ul style=\"margin-left: 40px;\">\n	<li>D&ugrave;ng để cấu h&igrave;nh v&ugrave;ng an to&agrave;n cho từng chỉ số nước , nếu ngo&agrave;i v&ugrave;ng an to&agrave;n th&igrave; sẽ cảnh b&aacute;o cho kh&aacute;ch h&agrave;ng.</li>\n	<li>N&uacute;t \"tải cấu h&igrave;nh mặc định\" d&ugrave;ng để tải cấu h&igrave;nh chỉ số chuẩn của ng&agrave;nh về v&ugrave;ng an to&agrave;n.</li>\n	<li>Muốn cập nhật ao n&agrave;o th&igrave; check v&agrave;o check box b&ecirc;n tr&aacute;i tương ứng với ao đ&oacute;. Kh&ocirc;ng cập nhật th&igrave; bỏ check.</li>\n</ul>\n','w04_nguongcanhbao',5,1,NULL),(6,'Mốc đo báo cáo',4,1,'Time slots','<p align=\"center\">H&igrave;nh ảnh mốc đo b&aacute;o c&aacute;o</p>\n<p align=\"center\"><img alt=\"\" height=\"501\" src=\"/images/newtech/images/mocdobaocao.png\" width=\"1000\"></p>\n<ol>\n	<li>C&aacute;ch đi đến trang \"Mốc đo b&aacute;o c&aacute;o\":</li>\n</ol>\n<ul style=\"margin-left: 40px;\">\n	<li>click v&agrave;o tab \"CẤU H&Igrave;NH\" tr&ecirc;n menu tab => click tab Mốc đo b&aacute;o c&aacute;o tr&ecirc;n menu con.</li>\n</ul>\n<p>&nbsp;&nbsp;&nbsp;&nbsp; 2. Chức năng của trang \"Mốc đo b&aacute;o c&aacute;o\":</p>\n<ul style=\"margin-left: 40px;\">\n	<li>D&ugrave;ng để c&agrave;i đặc c&aacute;c mốc đo (c&aacute;c khoảng thời gian) d&ugrave;ng cho \"b&aacute;o c&aacute;o nhanh\". Những mốc đo n&agrave;y thường người d&ugrave;ng quan t&acirc;m nhất. C&aacute;c chỉ số nước dao động mạnh ở những khoảng thời gian n&agrave;y l&agrave;m cho thủy sản dể ph&aacute;t bệnh.</li>\n	<li>M&agrave;u xanh l&agrave; c&aacute;c mốc đo đ&atilde; c&agrave;i đặt , m&agrave;u xanh nhạc l&agrave; mốc đo đang được chọn , m&agrave;u n&acirc;u l&agrave; mốc đo đang bỏ ...</li>\n	<li>C&oacute; thể tải mốc thời gian mặc định theo ng&agrave;nh.</li>\n	<li>Bấm n&uacute;t Lưu để lưu c&aacute;c thay đổi.</li>\n</ul>\n','w04_mocdo',6,1,NULL),(33,'Sơ đồ kêt nối',4,1,'Netword diagram','<p align=\"center\"><font size=\"4\">H&igrave;nh&nbsp; ảnh sơ đồ kết nối</font></p>\n<p align=\"center\"><font size=\"4\"><img alt=\"\" height=\"593\" src=\"/images/newtech/images/sodoketnoi.png\" width=\"1000\"></font></p>\n<ol>\n	<li><font size=\"4\">C&aacute;ch đến trang \"Sơ đồ kết nối\".</font></li>\n</ol>\n<ul style=\"margin-left: 40px;\">\n	<li>Click v&agrave;o tab \"CẤU H&Igrave;NH\" tr&ecirc;n menu tab => click tab \"Sơ đồ kết nối\" tr&ecirc;n menu con.</li>\n</ul>\n<p><font size=\"4\">&nbsp;&nbsp;&nbsp;&nbsp; 2. Chứng năng của trang \"Sơ đồ kết nối\".</font></p>\n<ul style=\"margin-left: 40px;\">\n	<li><font size=\"4\">Thể hiện sơ đồ tương t&aacute;c giữa c&aacute;c thực thể trong hệ thống, phần mềm, thiết bị phần cứng, người d&ugrave;ng, cơ sở dữ liệu.... &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </font></li>\n</ul>\n','w04_sodoketnoi',7,1,NULL);

