/* Trigger structure for table `sensorparser` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `last_data_trig` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `last_data_trig` AFTER INSERT ON `sensorparser` FOR EACH ROW INSERT INTO last_data (id_wasp,sensor,VALUE,TIMESTAMP)
   VALUES (NEW.id_wasp,NEW.sensor,NEW.value,NEW.timestamp)
   ON DUPLICATE KEY UPDATE VALUE=NEW.value,TIMESTAMP=NEW.timestamp */$$


